import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import arrow from "../../assets/icons/returnArrow.svg";
import cart from "../../assets/icons/shoppingCart.svg";
import "./styles.css";

class HeaArrow extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false,
    };
  }

  render() {
    return this.state.isLoggedIn ? (
      <Container>
        <Row className="justify-content-md-center header-div">
          <Col xs={3} md={3}>
            <img src={arrow} className="icon-arrow"></img>
          </Col>
        </Row>
      </Container>
    ) : (
      <Container>
        <Row className="justify-content-md-center header-div">
          <Col xs={3} md={3}>
            <img src={arrow} className="icon-arrow"></img>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default HeaArrow;
